import React from 'react';
import './societyTable.css';

const SocietyTable = () => {
  const data = [
    { id: 1, name: 'John Doe', address: '123 Main St' },
    { id: 2, name: 'Jane Smith', address: '456 Elm St' },
    { id: 3, name: 'Alice Johnson', address: '789 Oak St' }
  ];

  return (
    <div className="card-container">
      <h1>Society Card View</h1>
      <div className="card-wrapper">
        {data.map((item, index) => (
          <div className="card" key={index}>
            <h3>ID: {item.id}</h3>
            <p>Name: {item.name}</p>
            <p>Address: {item.address}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default SocietyTable;
